// src/pages/MyProfile.js
import React from 'react';
import './MyProfile.css';
import ProfileImage from '../components/ProfileImage,js';
import ProfileInfo from '../components/ProfileInfo,.js';
import CareerGoals from '../components/CareerGoals.js';
import Surveys from '../components/Surveys.js';

const MyProfile = () => {
    return (
        <div className="page">
            <nav className="navbar">
                <button className="nav-button">Main</button>
                <button className="nav-button">Employees</button>
                <button className="nav-button active">My Profile</button>
            </nav>
            <div className="profile-container">
                <div className="profile-section">
                    <ProfileImage src="profile-image-placeholder.png" alt="Profile" />
                    <ProfileInfo 
                        name="Maria Abrosova" 
                        title="Lead Python Developer" 
                        warning="High chance of quitting" 
                    />
                </div>
                <CareerGoals />
                <Surveys />
            </div>
        </div>
    );
};

export default MyProfile;
